import React, { Component } from "react";
import { Col } from "react-bootstrap";

export default class Hasil extends Component {
  render() {
    return (
      <Col md={3}>
        <h6>
          <strong>Hasil</strong>
        </h6>
        <hr />
      </Col>
    );
  }
}
